import React from "react";
import { Link } from "react-router-dom";

export default function Navbar(props) {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-light bg-dark">
        <h6 style={{ marginLeft: ".8rem", marginTop: ".6rem", color: "white" }}>
          {props.name}
        </h6>
        <div class="collapse navbar-collapse" id="navbarText">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item">
              <h6
                style={{
                  marginLeft: ".8rem",
                  marginTop: ".6rem",
                  color: "white",
                }}
              >
                {props.dob}
              </h6>
            </li>
            <li class="nav-item">
              <h6
                style={{
                  marginLeft: ".8rem",
                  marginTop: ".6rem",
                  color: "white",
                }}
              >
                {props.tier}
              </h6>
            </li>
            <li
              style={{
                marginLeft: ".8rem",
                marginTop: ".6rem",
                color: "white",
              }}
            >
              <h6>
                TOTAL COUNT:{" "}
                <span
                  className="badge bg-secondary"
                  style={{ marginLeft: ".3rem" }}
                >
                  This is the total count of all activities.
                </span>
              </h6>
            </li>
          </ul>
        </div>
      </nav>
      <div class="btn-group" role="group" aria-label="Basic example" style={{marginLeft:'30px'}}>
        <Link type="button" class="btn btn-primary" to="/">
          Activities
        </Link>
        <Link type="button" class="btn btn-primary" to="/rewards">
          Rewards
        </Link>
      </div>
    </>
  );
}
